import React from 'react';
import WaitlistForm from './components/WaitlistForm';
import Footer from './components/Footer';
import logo from './assets/unplug-logo.png'; // Add your logo to the assets folder

const App = () => {
  return (
    <div className="min-h-screen flex flex-col items-center bg-orange-500 text-white">
      <header className="w-full flex justify-between items-center p-6">
        <img src={logo} alt="Unplug Logo" className="h-12" />
        <div className="flex space-x-4">
          <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
            <img src="/path/to/instagram.png" alt="Instagram" className="h-8" />
          </a>
          <a href="https://tiktok.com" target="_blank" rel="noopener noreferrer">
            <img src="/path/to/tiktok.png" alt="TikTok" className="h-8" />
          </a>
        </div>
      </header>
      <main className="flex-grow flex flex-col items-center justify-center text-center">
        <h1 className="text-4xl md:text-6xl font-bold mb-6">The club that lets you disconnect to reconnect</h1>
        <p className="text-xl md:text-2xl mb-4">Join the waitlist<br />Be the first to hear about events</p>
        <WaitlistForm />
      </main>
      <Footer />
    </div>
  );
};

export default App;
